/**
 * Borders
 */
.notification {
  background: #5294E2 !important;
  color: #FFFFFF !important;
}
.notification .action {
  color: #FFFFFF !important;
}
.fixed-popover-container .fixed-popover {
  background: #2F343F;
  color: #B3BDCA;
}
.fixed-popover-container .fixed-popover input {
  background: transparent !important;
  box-shadow: none !important;
  border: none !important;
  color: #FFFFFF !important;
}
.fixed-popover-container .fixed-popover .btn {
  background: #5294E2;
  color: #FFFFFF;
}
.fixed-popover-container .fixed-popover h1,
.fixed-popover-container .fixed-popover h2,
.fixed-popover-container .fixed-popover h3,
.fixed-popover-container .fixed-popover h4,
.fixed-popover-container .fixed-popover h5,
.fixed-popover-container .fixed-popover h6 {
  color: #FFFFFF;
}
.fixed-popover-container .fixed-popover .text .content-dark {
  -webkit-filter: brightness(100);
  filter: brightness(100);
  padding-bottom: 1px;
}
